INSERT INTO `event` VALUES (11,'Elvis at Radhuni Princes Risborough','2015-03-18','Radhuni, Princes Risborough, High Wycombe. Bucks. HP27 9AA','Live dance and vocal entertainment accompanied by three course meal.',0.00,'','<p>Featuring Alvin, the Ultimate Tribute to Elvis, Radhuni Flackwell Heath are proud to once again bring a little of Las Vegas.</p>\r\n\r\n<p>Sure to be an evening of superb entertainment accompanied by our specially selected three course set menu dinner.</p>\r\n','1448543687Elvis_Risborough.jpg','2015-11-26 13:14:47'),(12,'Valentines Day','2015-02-14','Radhuni Princes Risborough, The Old Library, Church Street, Princes Risborough. HP27 9AA. ','Selectec Menu Designed by our Celebrity Chef and gift box.',0.00,'','<p>Valentines Day Treat for your loved one with Radhuni Princes Risborough.</p>\r\n\r\n<p>Why not enjoy an evening with a loved one this Valentines Day with a special evening at Radhuni Princes Risborough.</p>\r\n\r\n<p>Featuring a chocolate gift boxz, rose and specially selected menu, designed by our Celebrity Chef, just for the evening.</p>\r\n','1448544307rsb_valtentine2015x4.png','2015-11-26 13:25:07'),(13,'Rod Stewart tribute at Radhuni Princes Risborough.','2015-06-03','Radhuni, Princes Risborough, High Wycombe. Bucks. HP27 9AA','Live dance and vocal entertainment accompanied by three course meal.',0.00,'','<p>Dave Springfield as Rod Stewart evening, Radhuni Princes Risborough 3rd June 2015.</p>\r\n\r\n<p>Featuring the stunning Dave Springfield as Rod Stewart,  performing live vocals and performance.</p>\r\n\r\n<p>Featuring many of the artists classic and best loved numbers, Dave is the ultimate Rod Stewart performer and always a fantastic crowd pleaser.</p>\r\n','1448544890rsb_rosdstewart2015x4.png','2015-11-26 13:34:50'),(14,'Abba Sisters visit Radhuni','2015-09-03','Radhuni, Princes Risborough, High Wycombe. Bucks. HP27 9AA','Featuring a set menu for the evening',0.00,'','<p>The stunning ABBA Tribute band Abba Sisters Visit Rsdhuni for an evening of entertainment and fine dining.</p>\r\n\r\n<p>Get ready to party!</p>\r\n\r\n<p>Our AbbA duo will wow you and your friends with hits that made them famous.</p>\r\n','1448545207ABBA_Risb_web.png','2015-11-26 13:40:07'),(15,'Jazz night with Swing 42 Jazz','2015-10-27','Radhuni Princes Risborough, The Old Library. Princes Risborough. Buckinghamshire. HP27 9AA. ','Live Jazz entertainment accompanied by three cource set dinner menu.',0.00,'','<p>Jazz Night with Swing 42 Jazz at Radhuni Princes Risborough.</p>\r\n\r\n<p>Join us for a truly outstanding evening of entertainment with live Jazz provided by the stunning Swing 32 Jazz!</p>\r\n\r\n<p>Playing some classic Jazz numbers, accompanied by our selected set course menu the evening is sure go off with a swing.</p>\r\n','1448545508jazz_2015.png','2015-11-26 13:45:08'),(16,'Elvis Tribute Evening','2015-11-18','Radhuni Princes Risborough, The Old Library. Princes Risborough. Buckinghamshire. HP27 9AA. ','Live entertainment accompanied by three cource set dinner menu. ',0.00,'','<p>Elvis Tribute night at Radhuni Princes Risborough </p>\r\n\r\n<p>Join us for what is always a highly entertaining and engaging evening of entertainment with the stunning and hugely talented Alvin as the king himself, Elvis.</p>\r\n\r\n<p>Performing a range of stunning classics and not so well known numbers live and accompanied by hip gyration and swagger, Alvin is a performer that always delights and leaves the audience sure they were in the company of the man himself !</p>\r\n\r\n<p>Accompanied by our set menu for the evening this evening is sure to fill quickly so be sure to call early ! </p>\r\n','1448545709Elvis_Risbx400.png','2015-11-26 13:48:29'),(17,'New Years Eve 2015 with Robbie Williams tribute','2015-12-31','Radhuni, The Old Library, Princes Risborough.  ','New Years Eve featuring live vocals accompanied by fine dining.',0.00,'','<p>Celebrate New Years Eve at Radhuni Risborough accompanied by our live entertainment.</p>\r\n\r\n<p>Celebrate new years eve with Radhuni Princes Risborough. </p>\r\n\r\n<p>Featuring an evening of fine indian dining and live entertainment provided by the fabulous <strong>Robbie Williams</strong> tribute performer, David Williams.</p>\r\n\r\n<p>Always a popular entertainer, David performs a range of live vocals of popular numbers and is sure to provide a fitting welcome to 2016 at Radhuni.</p>\r\n\r\n<p>Accompanied by a sumptious three course find dining experience and champagne at midnigh to welcome to new year this is certain to be a truly entertaining evening worthy of welcoming the new year in !</p>\r\n','1448545897New_Years_Radhuni_Risborough_2016x400.png','2015-11-26 13:51:37'),(18,'Exclusive Evening with ABBA SISTERS Live Vocal','2016-03-02','The Old Library, Church Street, Princes Risborough, Bucks, HP27 9AA','Live dance and vocal entertainment accompanied by three course meal.',0.00,'','<p>The Abba Sisters are in town! Our Abba duo will wow you and your friends with the hits that made them famous. Their high energy, all singing, all dancing, choreographed Abba tribute show just can’t be missed.</p>\r\n','1453282720ABBA_Risb_WEB.jpg','2016-01-20 09:38:40');
/*!40000 ALTER TABLE `event` ENABLE KEYS */;
UNLOCK TABLES;

