INSERT INTO `faq` VALUES (4,'Disclaimer ','<p>Bengal Pride Restaurant Limited is registered with company house in England and Wales with registration number &ldquo;8139498&rdquo; with registered Address as 8 COMMERCIAL ROAD, LONDON E1 1NU, UK Trading as Becontree Tandoori&quot; We do not store any personal bank details including your credit card , Paypal id or password or any data is sensitive in nature.</p>\r\n\r\n<p><strong>Data we store:</strong></p>\r\n\r\n<p>We store your order history, some parts of your memorable date without year, your name, address, post code and email address.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Do we share data?</strong></p>\r\n\r\n<p>We do not share data with any other third party or companies for marketing purposes.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What types of Credit/Debit Card I can use?</strong></p>\r\n\r\n<p>We use Worldpay Payment service -accept all major credit &amp; debit card including Master, Visa, Solo etc</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>When I can get refund for order?</strong></p>\r\n\r\n<p>If you cancel your order within 10 minutes of placing your order than we will be able to cancel and refund your orders. In other case if there is any problem on our service and if you are not happy than we will refund your payment.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>When we will contact you?</strong></p>\r\n\r\n<p>We simply contact you only when we receive your orders, update you with order status, If order was cancelled or any problem with your payments. Also we will be in touch in your special designated dates via email or text to inform you about any offer matched with current date or future date.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>How long it takes to deliver my orders?</strong></p>\r\n\r\n<p>It is our aim to deliver food within 20 minutes of cooking and usually cooking requires a minimum of 25 minutes depending on the number of dish on your orders.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>I have allergy &ndash;what shall I be aware of?</strong></p>\r\n\r\n<p>Please inform us in advance on the phone or on the website when you placing your orders. We take allergen issue very seriously due to health risk factors. We also updated our menu with as much allergen information as possible to make you an informed choice.</p>\r\n','2015-11-19 14:31:09');
/*!40000 ALTER TABLE `faq` ENABLE KEYS */;
UNLOCK TABLES;

