INSERT INTO `home` VALUES (1,'Welcome to Radhuni Princes Risborough','Online Food & Reservation Service','<p>Established in 2004, and still proudly providing the best Indian and Bangladeshi cuisine in style and comfort. Radhuni is open seven days a week, including bank holidays.</p>\r\n\r\n<p>At Radhuni we are proud to serve the finest selection of Indian and Bangladeshi dishes, prepared by our highly experienced chefs to your liking. On our menu you will find a selection of traditional and well known dishes alongside our specially selected range of dishes, unique to the restaurant.</p>\r\n\r\n<p>The restaurant features a contemporary decor amid stunning 550-year old architecture, located conveniently within Princes Risborough with ample free and convenient parking.</p>\r\n\r\n<p>At Radhuni Group we pride ourselves on provided the highest level of customer service amongst a pleasant and relaxed atmosphere. You will find our staff eager to ensure your visit is a pleasurable experience, meeting your every requirement, without being too stifling.</p>\r\n\r\n<p>We welcome your feedback, good and bad, and welcome you to complete our online or in restaurant comment cards at your convenience.</p>\r\n','2015-11-16 13:23:09');
