INSERT INTO `offers` VALUES (3,'Radhuni Spice club:','<p>The Radhuni Spice Club enables our registered members to take advantage of special offers, early registration for theme events and discounts when dining with any of the Radhuni group restraunts.</p>\r\n','Benefits Of Radhuni Spice Club Membership:','<ul>\r\n <li>Discounts on dining in and takeaway orders</li>\r\n <li>Special set lunch & business lunch</li>\r\n <li>Early booking for theme events</li>\r\n <li>Radhuni Spice Club members card</li>\r\n <li>£10 voucher for dining in on joining</li>\r\n</ul>\r\n','Terms and Conditions:','<p>1) The card cannot be used in conjunction with any other offers or promotion, or special menu including business lunches or buffets,special events ,special day or new years eve etc.</p>\r\n\r\n<p>2) Only one loyalty card may be used per table or order and card will not be accepted with voucher.</p>\r\n','1447509861radhuni_group.png','2015-11-14 14:04:21');
